import React from 'react';

const LoginPage = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        width: '100%',
        height: '100vh',
      }}
    >
      <form>
        <label>Email</label>
      </form>
    </div>
  );
};

export default LoginPage;
